var b="url",c="登录后制作.html",d="generationDate",e=new Date(1589003592859.93),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="cd5437551a434909bd618569067c7471",u="type",v="Axure:Page",w="登录后制作",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="b07924323fb94b4a8e3e8e2695732d2c",D="label",E="搜索",F="说明",G="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">参考apple官网搜索，</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">鼠标</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">放置</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">展示，点击后</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">抬头变成搜索栏，输入进行快速搜索。</span></p>",H="2",I="832ce3d1e8f8405594ae76fdef9ba326",J="讨论",K="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转讨论页面</span></p>",L="3",M="37fe36c59a8e4c08be8ba0baf65b2600",N="制作",O="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转制作页面</span></p>",P="4",Q="2fe213045f6f41e98d6a86090120bc8d",R="发现",S="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转发现页面</span></p>",T="5",U="1d07a39addf344c68378776e6827da92",V="logo只在不显示抬头时展现",W="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">只有在完全打开左边栏并且抬头完全没有显示的时候才会出现。</span></p>",X="6",Y="d749d30afc8743a1a8726ce6c74c3404",Z="左边栏扩展选项",ba="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">左边栏的预览和打开，左边栏为快捷栏目，包括用户</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">登录、搜索、联系官方、上传、语言/地域选择，等未登录的标准内容。（登录后展开自定义选项，在我的里面进行修改）</span></p><p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">左边栏在打开后会随着页面浏览向下，更类似与youtube的左边栏，感觉不动，动的是浏览内容。</span></p>",bb="7",bc="84e16829b62f4198b0ea78d556dd9555",bd="自定义快捷菜单6",be="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">跳转搜索页面</span></p>",bf="8",bg="92d0a569ac674c92a88dc13fdc2f267d",bh="自定义快捷菜单3（上传）",b